
var game;
var gameLoaded = false;
var createOnLoaded = false;
var num = 0,falg = 0,n_d 
window.onload = function () {
    var gameConfig = {
        type: Phaser.AUTO,
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],addFlag = false;
        
        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this.bg = this.add.image(0,0,'bg').setOrigin(0,0).setInteractive()
        var pan = this.add.image(256,700,'pan')
        var title = this.add.image(256,70,'title')
        this.sofa = this.add.image(287,450,'sofa').setDepth(1)
        this.door = this.add.image(322,265,'door').setDepth(1)

        this.showParticle()
        this.showWife()
        this.showMan()
        this.showArticle()
        this.showHand()
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }
    update(){
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this.sitDown()
        switch (n_d) {
            case 1:
                this.star.setPosition(this.shoe.x, this.shoe.y)
                break;
            case 2:
                this.star.setPosition(this.underwear.x, this.underwear.y)
                break;
            case 3:
                this.star.setPosition(this.Panties.x, this.Panties.y)
                break;
            default:
                break;
        }
        
    }

    showHand(){
        this.hand = this.add.image(180,400,'hand').setOrigin(0,0).setDepth(10).setScale(0.7,0.7).setAngle(45)
        var st = setInterval(() => {
            this.tweens.add({
                targets:[this.hand],
                scaleX:0.6,
                scaleY:0.6,
                duration:300,
                onComplete:()=>{
                    this.tweens.add({
                        targets:[this.hand],
                        scaleX:0.7,
                        scaleY:0.7,
                        duration:300,
                        onComplete:()=>{
                            
                        }
                    })
                }
            })
        }, 600);
        this.bg.on('pointerdown',(pointer)=>{
            var wrong = this.add.image(pointer.x,pointer.y,'wrong').setDepth(10).setScale(0.2,0.2)
            this.tweens.add({
                targets:[wrong],
                angle:30,
                duration:200,
                onComplete:()=>{
                    this.tweens.add({
                        targets:[wrong],
                        angle:-30,
                        duration:200,
                        onComplete:()=>{
                            wrong.destroy()
                        }
                    })
                }
            })
        })
        this.input.on('pointerdown',()=>{
            this.hand.alpha = 0
            clearInterval(st)
            this.input.off('pointerdown')
        })
    }

    showParticle(){
        this.star= this.add.particles('blue').createEmitter({
            x: 400,
            y: 300,
            blendMode: 'SCREEN',
            scale: { start: 0.2, end: 0 },
            speed: { min: 0, max: 30 },
            quantity: 2
        });

        this.emitter = this.add.particles('star').createEmitter({
            x: 256,
            y: 400,
            // blendMode: 'SCREEN',
            scale: { start: 0.2, end: 0 },
            speed: { min: 100, max: 100 }, 
            rotate:{ min: 0, max: 360 },
            quantity: 40,
            frequency: -1,
            lifespan:800
        });
        this.emitZones = [];

        this.emitZones.push({
            source: new Phaser.Geom.Circle(0, 0, 30),
            type: 'edge',
            quantity: 14,
        });
        this.star.visible = 0
    }

    showWife(){
        this.wife1 = this.add.image(0,400,'wife1png')
        this.wife2 = this.add.image(60,400,'wife2png').setVisible(0)
        this.wife3 = this.add.image(60,400,'wife3png').setVisible(0)
        this.wife4 = this.add.image(60,400,'wife4png').setVisible(0)
        this.tweens.add({
            targets:[this.wife1],
            x:this.wife1.x+60
        })
    }


    showMan(){
        this.man1 = this.add.image(400,340,'man')
        this.man2 = this.add.image(400,340,'man2').setVisible(0)
        this.man_a1 = this.add.image(400,340,'man_a1').setVisible(0)
        this.man_a2 = this.add.image(400,340,'man_a2').setVisible(0)
        this.man_a3 = this.add.image(400,340,'man_a3').setVisible(0)
        setTimeout(() => {
            this.man1.visible = 0
            this.man2.visible = 1
        }, 400);
        setTimeout(() => {
            this.man1.visible = 1
            this.man2.visible = 0
        }, 800);
        this.man_st = setInterval(() => {
            setTimeout(() => {
                this.man1.visible = 0
                this.man2.visible = 1
            }, 400);
            setTimeout(() => {
                this.man1.visible = 1
                this.man2.visible = 0
            }, 800);
        }, 800);
    }

    showArticle(){
        var this_ = this
        this.shoe = this.add.image(160,520,'shoe').setInteractive().once('pointerdown',function(){
            this_.star.visible = 1
            n_d = 1
            num++
            this_.tweens.add({
                targets:[this],
                x:100,
                y:690,
                duration:500,
                onComplete:()=>{
                    this_.star.visible = 0
                    this_.emitter.setPosition(this_.shoe.x, this_.shoe.y)
                    this_.emitter.setEmitZone(this_.emitZones[0]);
                    this_.emitter.explode();
                }
            })
        })
        this.underwear = this.add.image(300,440,'underwear').setDepth(2).setInteractive().once('pointerdown',function(){
            this_.star.visible = 1
            n_d = 2
            num++
            this_.tweens.add({
                targets:[this],
                x:256,
                y:690,
                duration:500,
                onComplete:()=>{
                    this_.star.visible = 0
                    this_.emitter.setPosition(this_.underwear.x, this_.underwear.y)
                    this_.emitter.setEmitZone(this_.emitZones[0]);
                    this_.emitter.explode();
                }
            })
        })
        this.Panties = this.add.image(180,400,'Panties').setDepth(2).setInteractive().once('pointerdown',function(){
            this_.star.visible = 1
            n_d = 3
            num++
            this_.tweens.add({
                targets:[this],
                x:415,
                y:690,
                duration:800,
                onComplete:()=>{
                    this_.star.visible = 0
                    this_.emitter.setPosition(this_.Panties.x, this_.Panties.y)
                    this_.emitter.setEmitZone(this_.emitZones[0]);
                    this_.emitter.explode();
                }
            })
        })
    }

    sitDown(){
        if(num == 1){
            this.man1.alpha = 0
            this.man2.alpha = 0
            this.wife1.visible = 0
            clearInterval(this.man_st)
            this.man_a1.visible = 1
            this.wife2.visible = 1
        }
        if(num == 2){
            this.man_a1.visible = 0
            this.wife2.visible = 0
            this.man_a2.visible = 1
            this.wife3.visible = 1
        }
        if(num == 3){
            this.man_a2.visible = 0
            this.wife3.visible = 0
            this.man_a3.visible = 1
            this.wife4.visible = 1
            setTimeout(() => {
                if(falg == 0){
                    this.showDownload()
                    falg = 1
                }

            }, 2000);
        }
    }

    showDownload(){
        this.bg.off('pointerdown')
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics1= this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.8;
        graphics1.setDepth(8);
        graphics1.fillRectShape(rect);
        var win_bg = this.add.image(256,-400,'win_btn').setDepth(10)
        var down = this.add.image(256,520,'button').setDepth(10).setScale(0,0).setInteractive().on('pointerdown',()=>{
            landingPage()
        })
        this.tweens.add({
            targets:[win_bg],
            y:400,
            duration:800,
            ease:'Back',
            onComplete:()=>{
                this.tweens.add({
                    targets:[down],
                    scaleX:1,
                    scaleY:1,
                    duration:500,
                    onComplete:()=>{
                        this.tweens.add({
                            targets:[down],
                            scaleX:1.1,
                            scaleY:1.1,
                            duration:300,
                            onComplete:()=>{
                                this.tweens.add({
                                    targets:[down],
                                    scaleX:1,
                                    scaleY:1,
                                    duration:300,
                                    onComplete:()=>{
                                        
                                    }
                                })
                            }
                        })
                        setInterval(() => {
                            this.tweens.add({
                                targets:[down],
                                scaleX:1.1,
                                scaleY:1.1,
                                duration:300,
                                onComplete:()=>{
                                    this.tweens.add({
                                        targets:[down],
                                        scaleX:1,
                                        scaleY:1,
                                        duration:300,
                                        onComplete:()=>{
                                            
                                        }
                                    })
                                }
                            })
                        }, 600);

                    }
                })
            }
        })
    }

    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        }
        else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
}

var assets = {"shoe": "data:image/png;base64,", "star": "data:image/png;base64,", "Panties": "data:image/png;base64,", "blue": "data:image/png;base64,", "man2": "data:image/png;base64,", "title": "data:image/png;base64,", "pan": "data:image/png;base64,", "bg": "data:image/png;base64,", "door": "data:image/png;base64,", "wife2png": "data:image/png;base64,", "hand": "data:image/png;base64,", "wrong": "data:image/png;base64,", "wife3png": "data:image/png;base64,", "wife4png": "data:image/png;base64,", "man": "data:image/png;base64,", "underwear": "data:image/png;base64,", "sofa": "data:image/png;base64,", "button": "data:image/png;base64,", "win_btn": "data:image/png;base64,", "man_a2": "data:image/png;base64,", "man_a3": "data:image/png;base64,", "man_a1": "data:image/png;base64,", "wife1png": "data:image/png;base64,"}